import './style.css';

function App() {
  return (
    <>
      <header className="header">
        <div className="logo">
          <img src="logo.png" />
          <h1>Share Your Route</h1>
        </div>
        <button className="btn btn-large btn-open">Share Your Route</button>
      </header>
      <NewRouteForm />
      <main class="main">
        <CategoriesAside />
        <RouteList />
      </main>
    </>
  );

}
function CategoriesAside() {
  return (
    <aside >Caregories Aside </aside>

  );
}
function NewRouteForm() {
  return (
    <form className="route-form ">
      <h2>Share Your Route</h2>
      <input type="text" name="text" placeholder="Share your route" />
      <input type="text" name="source" placeholder="Source" />
      <input type="text" name="category" placeholder="Category" />
      <button type="submit">Share</button>
    </form>
  );
}
function RouteList() {
  return (
    <section >Routes list </section>
  );
}
export default App;
